import React from "react";

const UsersList = ({ onMakeUser }) => {
  return (
    <ul>
      {onMakeUser.map((user) => (
        <li key={user.id}>
          {user.username} ({user.password} years old)
        </li>
      ))}
    </ul>
  );
};

export default UsersList;
